// PUT = MODIFICAR DATOS
rutaUser.put("/user", verifyToken, modifyUser);

// DELETE = ELIMINAR DATOS
rutaUser.delete("/user", verifyToken, deleteUser);

// LOGIN
rutaUser.post("/login", logUser);

export default rutaUser;

